import "../css/style.css";
import "font-awesome/css/font-awesome.min.css";
import "bootstrap-social";
import '../bootstrap/dist/css/bootstrap.min.css';

const Footer = () => {
  return (
    <footer>
      <div className="container">
        <div className="footer-content d-flex justify-content-between">
          {/* Information Section */}
          <div className="footer-section col-md-6">
            <h3>Information</h3>
            <p>
              Nguyen Trai High School, 01 Phan Van Dinh, Lien Chieu District, Da Nang City
            </p>
          </div>

          {/* Liên hệ Section */}
          <div className="footer-section col-md-6">
            <h3>Liên hệ</h3>
            <p>Email: thptnguyentraidng01@gmail.com</p>
            <p>Social Media:</p>

            {/* Logos */}
            <span><i className="fa fa-facebook"></i></span>
            <span className="logo-footer"><i className="fa fa-instagram"></i></span>
            <span className="logo-footer"><i className="fa fa-envelope"></i></span>
            <span className="logo-footer"><i className="fa fa-twitter"></i></span>
          </div>
        </div>

        <div className="footer-bottom">
          TRƯỜNG THPT NGUYỄN TRÃI - ĐÀ NẴNG
        </div>
      </div>
    </footer>
  );
};

export default Footer;
